import React, { useState } from "react";
import { youreAlwaysCoolHOC1 } from "../HOC/test";
import { Button, Form } from "react-bootstrap";

function RegistrationForm() {
  return (
    <div className="form">
      <div className="form-body">
        <Form.Group className="mb-3" controlId="exampleForm.ControlInput1">
          <Form.Label size="lg">Login</Form.Label>
          <Form.Control size="lg" type="email" placeholder="name@example.com" />
        </Form.Group>

        <Form.Group className="mb-3" controlId="exampleForm.ControlInput1">
          <Form.Label size="lg">Password</Form.Label>
          <Form.Control size="lg" type="password"  />
        </Form.Group>

        <Form.Group className="mb-3" controlId="exampleForm.ControlInput1">
          <Form.Label size="lg">Confirm Password</Form.Label>
          <Form.Control size="lg" type="password"  />
        </Form.Group>
        </div>
        <div className="d-grid gap-2">
        <Button variant="primary" size="lg">
            Register
        </Button>
        </div>
    </div>
  );
}

export default RegistrationForm;
